  def computeLinkDistance minDistOnly
    allData=Array.new

    CSV.foreach("/var/www/Ruby/sar/public/mindist.csv", :headers => true) do |row|

      allData.push row

    end

    if !minDistOnly
     distance=Array.new
    else
      distance=Hash.new
    end

    allData.each do |data1|
      puts data1[0]

      allData.each do |data2|
        if data1[0]!=data2[0]

          if minDistOnly

            if distance[data1[0]]!=nil

              if distance[data1[0]][2]>LocationUtil.distance([data1[3].to_f,data1[4].to_f],[data2[1].to_f,data2[2].to_f])
                distance[data1[0]]=[data1[0],data2[0],LocationUtil.distance([data1[3].to_f,data1[4].to_f],[data2[1].to_f,data2[2].to_f])]
              end
            else
              distance[data1[0]]=[data1[0],data2[0],LocationUtil.distance([data1[3].to_f,data1[4].to_f],[data2[1].to_f,data2[2].to_f])]
            end
          else
            distance.push([data1[0],data2[0],LocationUtil.distance([data1[3].to_f,data1[4].to_f],[data2[1].to_f,data2[2].to_f])])
          end


        else

          if !minDistOnly
            distance.push ([data1[0],data2[0],100000000000])
          else
            distance[data1[0]]=[data1[0],data2[0],100000000000]
          end


        end

      end
    end

    CSV.open( "/var/www/Ruby/sar/public/mindistfin.csv", 'w' ) do |writer|
      if !minDistOnly

        distance.each do |c|
          writer << c
        end
      else

        distance.each do |k,c|
          writer << c
        end
      end
    end

  end


  def computePerpendiularDistance
    allData=Array.new

    CSV.foreach("/var/www/Ruby/sar/public/mindist.csv", :headers => true) do |row|

      allData.push row

    end
    distance=Array.new

    allData.each do |data1|
      puts data1[0]

      allData.each do |data2|
        if data1[0]!=data2[0] && LocationUtil.distance([data1[1].to_f,data1[2].to_f],[data2[1].to_f,data2[2].to_f])<3000 && LocationUtil.perpendicularDistance([data1[1].to_f,data1[2].to_f],[data1[3].to_f,data1[4].to_f],[data2[1].to_f,data2[2].to_f],[data2[3].to_f,data2[4].to_f])<=50

          distance.push([data1[0],data2[0]])

        else

#          distance.push ([data1[0],data2[0],100000000000])

        end

      end
      break

    end

    CSV.open( "/var/www/Ruby/sar/public/perpendFin.csv", 'w' ) do |writer|
      distance.each do |c|
        writer << c
      end
    end
  end

  def referralVis

    polyLine=Array.new

    RouteSuggest.all.each do |route|

      polyLine.push Polylines::Decoder.decode_polyline(route.route_points)

    end

    @routes=polyLine

  end
