          locationInsert.push("(#{ActiveRecord::Base.connection.quote(value1)},'2016-09-22 00:00:47','2016-09-22 00:00:47')")
        end
        routeLocationInsert.push "("+routeHash[key].to_s+","+locationHash[value1].to_s+",'2016-09-22 00:00:47','2016-09-22 00:00:47')"
      }

    end

    last=0
    while true
      if routeLocationInsert.slice(last,10)!=nil

        ActiveRecord::Base.connection.execute("insert into dtc_route_locations (`routeid`,`locationid`,`created_at`,`updated_at`) values "+routeLocationInsert.slice(last,10).join(","))
      end
      if routeInsertA.slice(last,10)!=nil
        ActiveRecord::Base.connection.execute("insert into dtc_routes (`name`,`created_at`,`updated_at`) values "+routeInsertA.slice(last,10).join(","))
      end
      if locationInsert.slice(last,10)!=nil

        ActiveRecord::Base.connection.execute("insert into dtc_locations (`name`,`created_at`,`updated_at`) values "+locationInsert.slice(last,10).join(","))
      end
      if routeLocationInsert.slice(last,10)==nil &&
          routeInsertA.slice(last,10)==nil &&
          locationInsert.slice(last,10)==nil
        break
      end
      last=last+10
    end


  end
end
